import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Image, ScrollView } from 'react-native';
import MenuButton from './components/menuButton';
import Navbar from './components/navbar';
import './components/icons';
import { icons } from './components/icons';

export default function App() {
  return (
    <View style={styles.container}>
      <Navbar />
      <ScrollView style = {{marginTop: 10}}>
       <MenuButton icon = {icons.task} Text={'ZADANIA'}></MenuButton>
       <MenuButton icon = {icons.calendar} Text={'KALENDARZ'}></MenuButton>
       <MenuButton icon = {icons.cake} Text={'WYDARZENIA'}></MenuButton>
       <MenuButton icon = {icons.marker} Text={'NOTATKI'}></MenuButton>
       <MenuButton icon = {icons.profile} Text={'PROFIL'}></MenuButton>
       <MenuButton icon = {icons.settings} Text={'USTAWIENIA'}></MenuButton>
      </ScrollView>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FFEEA4',
    alignItems: 'center',
    justifyContent: 'flex-start',
  },
});
